    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE + + col2 / - 99 * ( - - ( - - col1 ) ) NOT BETWEEN - - 11 AND NULL;
  - name: tab0

outputs:
  - name: q1546.out
    data: |
      15	81	47
      87	21	10
      97	1	99
